import { createProjector, VNode } from "maquette";
import { jsx } from "maquette-jsx";

import MapView from "@arcgis/core/views/MapView";
import config from "@arcgis/core/config";

import { Point } from "@arcgis/core/geometry";

import OverlayLayer from "@arcgis/core/layers/OverlayLayer";

import WebMap from "@arcgis/core/WebMap";

export function overlayApplication() {
  config.assetsPath = new URL(
    "../dist/assets/",
    window.location.href
  ).toString();

  // xmin = -20037508
  // xmax = 20037508
  // delta = 40075016

  const width = 2226390.08;
  const height = 4745776;
  const xmin = -11131949.08; //  // 12924312.96;
  const ymin = 2875744.62;

  const topLeft = new Point({
    x: xmin - width,
    y: ymin + height,
  });

  const topRight = new Point({
    x: xmin + width,
    y: ymin + height,
  });

  const bottomLeft = new Point({
    x: xmin,
    y: ymin,
  });

  const bottomRight = new Point({
    x: xmin + width * 2,
    y: ymin,
  });

  const overlay = {
    editable: false,
    opacity: 0.8,
    source:
      "data:image/jpeg;base64,",
    coords: {
      topLeft,
      topRight,
      bottomLeft,
      bottomRight,
    },
  };

  const layer = new OverlayLayer({
    overlays: [overlay],
  });

  let view: MapView = new MapView({
    map: new WebMap({
      basemap: "topo-vector",
      layers: [layer],
    }),
    popup: {
      defaultPopupTemplateEnabled: true,
    },
    zoom: 4,
    center: [-100, 40],
    constraints: {
      snapToZoom: false,
    },
  });

  //Renders the application content
  function render() {
    return (
      <calcite-shell>
        <header slot="shell-header">
          <h2 style="margin-left: 30px">Road Ahead - 3.x MapImageLayer</h2>
        </header>
        <div style="padding: 0; margin: 0; height: 100%; width: 100%;">
          <div
            style="padding: 0; margin: 0; height: 100%; width: 100%;"
            afterCreate={createMapView}
          ></div>
        </div>
      </calcite-shell>
    );
  }
  function createMapView(container: HTMLDivElement) {
    view.container = container;

    view.whenLayerView(layer).then((overlayLayerView: any) => {
      view.on("pointer-move", function (event) {
        if (!overlayLayerView || !overlay.editable) {
          return;
        }

        // get the graphic from the layerView graphics collection
        const graphic = overlayLayerView._graphics.items[0];
        const polygon = graphic.geometry.clone();

        // this will be the ne center
        let point = view.toMap({ x: event.x, y: event.y });
        const offsetX = width / 2;
        const offsetY = height / 2;
        const rings = [
          [
            [point.x - offsetX, point.y + offsetY],
            [point.x + offsetX, point.y + offsetY],
            [point.x + offsetX, point.y - offsetY],
            [point.x - offsetX, point.y - offsetY],
            [point.x - offsetX, point.y + offsetY],
          ],
        ];

        polygon.rings = rings;
        graphic.geometry = polygon;
      });

      view.on("click", function (event) {
        overlay.editable = !overlay.editable;
      });
    });
  }

  const projector = createProjector();
  projector.append(document.body, render);
}
